import './MainPoints.css';

function MainPoints() {


    return (
        <div className='main-points-wrapper'>
            <div className='grid-wrapper'>
                <div className='main-points-grid white-text'>

                    <div className='main-points-item item1'>

                    </div>

                    <div className='main-points-item item2'>

                    </div>

                    <div className='main-points-item item3'>

                    </div>

                    <div className='main-points-item item4'>

                    </div>

                    <div className='main-points-item item5'>

                    </div>

                    <div className='main-points-item item6'>

                    </div>

                </div>
            </div>
        </div>
    );
}

export default MainPoints;
